import React from 'react'
import {Container ,Content ,Title ,Desc} from './style'
const Project = () => {
    return (
      <Container>
          <Content>
            <Title></Title>
            <Desc>Introducing our first official project</Desc>
          </Content>
      </Container>
    )
}

export default Project
